import logo from "./logo.svg";
import "./App.css";
import MyHeader from "./components/MyHeader";
import "bootstrap/dist/css/bootstrap.min.css";
import MyFooter from "./components/MyFooter";
import Welcome from "./components/Welcome";

function App() {
  return (
    <>
      <MyHeader />
      <Welcome />
      <MyFooter />
    </>
  );
}

export default App;
